// src/components/Sidebar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
    return (
        <div className="bg-gray-800 text-white w-1/4 h-screen flex flex-col shadow-md">
            <h1 className="text-2xl font-bold text-center my-4">Study Buddy</h1>
            <nav className="flex flex-col items-center">
                <Link to="/" className="py-4 hover:bg-gray-700 w-full text-center transition-colors duration-200">Home</Link>
                <Link to="/settings" className="py-4 hover:bg-gray-700 w-full text-center transition-colors duration-200">Settings</Link>
                <Link to="/user" className="py-4 hover:bg-gray-700 w-full text-center transition-colors duration-200">User</Link>
            </nav>
        </div>
    );
};

export default Sidebar;
